import React from "react";
import estilos from "About.module.css";
//creo el componente funcional About que se mostrará en la ruta /about
export default function About(){
    return(
        <div className={estilos.general}>
            <h4>Ramira, Matías.</h4>
            <p>Vivo en Entre Rios, Paraná. Tengo 22 años y odio el front-end.</p>
        </div>
    )
}
